BEGIN TRANSACTION;
DROP TABLE IF EXISTS "WaterbodyBounds";
CREATE TABLE IF NOT EXISTS "WaterbodyBounds" (
	"OBJECTID"	INTEGER,
	"x_min"	REAL,
	"x_max"	REAL,
	"y_min"	REAL,
	"y_max"	REAL,
	PRIMARY KEY("OBJECTID")
);
DROP TABLE IF EXISTS "DailyStatus";
CREATE TABLE IF NOT EXISTS "DailyStatus" (
	"year"	INTEGER,
	"day"	INTEGER,
	"OBJECTID"	INTEGER,
	"status"	TEXT,
	"timestamp"	TEXT,
	"comments"	TEXT,
	PRIMARY KEY("year","day","OBJECTID")
);
DROP TABLE IF EXISTS "DailyData";
CREATE TABLE IF NOT EXISTS "DailyData" (
	"year"	INTEGER,
	"day"	INTEGER,
	"OBJECTID"	INTEGER,
	"value"	INTEGER,
	"count"	INTEGER,
	PRIMARY KEY("year","day","OBJECTID","value")
);
DROP TABLE IF EXISTS "GeometryTile";
CREATE TABLE IF NOT EXISTS "GeometryTile" (
	"OBJECTID"	INTEGER,
	"tileName"	TEXT
);
DROP TABLE IF EXISTS "WeeklyData";
CREATE TABLE IF NOT EXISTS "WeeklyData" (
	"year"	INTEGER,
	"day"	INTEGER,
	"OBJECTID"	INTEGER,
	"value"	INTEGER,
	"count"	INTEGER,
	PRIMARY KEY("year","day","OBJECTID","value")
);
DROP TABLE IF EXISTS "WeeklyStatus";
CREATE TABLE IF NOT EXISTS "WeeklyStatus" (
	"year"	INTEGER,
	"day"	INTEGER,
	"OBJECTID"	INTEGER,
	"status"	TEXT,
	"timestamp"	TEXT,
	"comments"	TEXT,
	PRIMARY KEY("year","day","OBJECTID")
);
COMMIT;
